import React from 'react';
import logo from './logo.svg';
import Home from './Home';
import { Route, Switch } from "react-router-dom"

function App() {
  return (
    <main>
      <Switch>
        <Route path='/' component={Home}/>
        <Route path='/rest-api' component={RESTAPIMenu}/>
      </Switch>
    </main>
  );
}

export default App;
